import React from "react";

const MealTypeSearch = () => {
  const mealTypeArr = [
    "main course",
    "side dish",
    "dessert",
    "appetizer",
    "salad",
    "bread",
    "breakfast",
    "soup",
    "beverage",
    "sauce",
    "marinade",
    "fingerfood",
    "snack",
    "drink",
  ];
  const firstHalf = mealTypeArr.filter((type, index) => {
    index < index.length / 2;
  });
  const displayMealTypes = mealTypeArr.map((type) => {
    return (
      <>
        <p className="criteriaBullet">{type}</p>
      </>
    );
  });
  return (
    <div className="col-6">
      <p className="searchBy">Meal Type</p>
      <div className="row">
        <div className="col-6">{displayMealTypes}</div>
        <div className="col-6"></div>
      </div>
    </div>
  );
};

export default MealTypeSearch;
